import React, { Component } from 'react';
 import Navbar from './components/Navbar';
import './custom.css';
import StudentCurd from './components/StudentCurd';
import { BrowserRouter as Router, Routes, Switch } from "react-router-dom";

export default class App extends Component {
  static displayName = App.name;

  render() {
      return (
        
        <>
        <Router>
          <Navbar />
         
            <Switch>
            <StudentCurd
            height={4}
            color="#f11946"
            progress={this.state.progress}
          />
           <Route exact path="/Login">
            
              <Login/>
            </Route>
            <Route exact path="/SignUp">
              {" "}
              <SignUp/>
            </Route>
         
          <Route exact path="/">
              {" "}
              <News
                setProgress={this.setProgress}
                apiKey={this.apiKey}
                key="science"
                pageSize={this.pageSize}
                country="in"
                category="science"
              />
            </Route>
            <Route exact path="/business">
              {" "}
              <News
                setProgress={this.setProgress}
                apiKey={this.apiKey}
                key="business"
                pageSize={this.pageSize}
                country="in"
                category="business"
              />
            </Route>
            <Route exact path="/entertainment">
              {" "}
              <News
                setProgress={this.setProgress}
                apiKey={this.apiKey}
                key="entertainment"
                pageSize={this.pageSize}
                country="in"
                category="entertainment"
              />
            </Route>
            <Route exact path="/general">
              {" "}
              <News
                setProgress={this.setProgress}
                apiKey={this.apiKey}
                key="general"
                pageSize={this.pageSize}
                country="in"
                category="general"
              />
            </Route>
            <Route exact path="/health">
              {" "}
              <News
                setProgress={this.setProgress}
                apiKey={this.apiKey}
                key="health"
                pageSize={this.pageSize}
                country="in"
                category="health"
              />
            </Route>
            <Route exact path="/science">
              {" "}
              <News
                setProgress={this.setProgress}
                apiKey={this.apiKey}
                key="science"
                pageSize={this.pageSize}
                country="in"
                category="science"
              />
            </Route>
            <Route exact path="/sports">
              {" "}
              <News
                setProgress={this.setProgress}
                apiKey={this.apiKey}
                key="sports"
                pageSize={this.pageSize}
                country="in"
                category="sports"
              />
            </Route>
            <Route exact path="/technology">
              {" "}
              <News
                setProgress={this.setProgress}
                apiKey={this.apiKey}
                key="technology"
                pageSize={this.pageSize}
                country="in"
                category="technology"
              />
            </Route>
          </Switch>
        </Router>
           </>
          
    );
  }
}
